import React, { Component } from "react";
import { Link } from "react-router-dom";
import "tachyons";

import Footer from "./Footer";
import Copyright from "./Copyright";

const SubStyle = {
  color: "#fec503"
};

class Tuberculosis extends Component {
  render() {
    return (
      <div className="tc">
        <h1 className="tc mt6-ns f1 lh-title" style={SubStyle}>
          TUBERCULOSIS
        </h1>
        <div className="dib col-xl-8 col-sm-10 mb-10">
          <Link to="#">
            <div className="bg-white rounded shadow-sm py-5 px-4 tc ma4-ns">
              <h1 className="mb-0">
              <input type="file" />
              </h1>
            </div>
          </Link>
          <h3 className="mb-0">
            <button
              type="button"
              className="ma4 pa3-ns btn btn-outline-warning"
            >
              Generate Report
            </button>
          </h3>
        </div>
        <Footer />
        <Copyright />
      </div>
    );
  }
}

export default Tuberculosis;
